description:
Verenigde Staten
Thriller
85 minuten

een goeie film

met Luke Wilson, Kate Beckinsale en Frank Whaley

De auto van David en Amy Fox begeeft het in een verlaten gebied. Hierdoor zijn ze gedwongen de nacht door te brengen in het 
enige motel in de omgeving. Ze vermaken zich met wat horrorfilmpjes op de t.v. in de kamer, tot ze er achter komen dat die 
filmpjes opgenomen zijn in dezelfde kamer waar ze nu zitten en de camera's er nog hangen...
